import React from 'react';

export const Navbar = () => {
	return (
		<nav className="navbar navbar-expand navbar-light bg-light">
			<div className="nav navbar-nav">
				<a className="nav-item nav-link active" href="#">
					Home
				</a>
				<a className="nav-item nav-link" href="#">
					Signup
				</a>
				<a className="nav-item nav-link" href="#">
					login
				</a>
			</div>
		</nav>
	);
};
